import React from 'react';
import { motion } from 'framer-motion';
import './Services.css';

const Services = () => {
  return (
    <motion.div
      className="services-container"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.8 }}
    >
      <h1>Our Services</h1>
      <p>We offer cinematic production, post-production, and storytelling consultation for powerful narratives.</p>
    </motion.div>
  );
};

export default Services;
